real_t solve_dim40_system( real_t* const A, real_t* const b, int* const rk_perm )
{
real_t det;

int i;
int j;
int k;

int indexMax;

int intSwap;

real_t valueMax;

real_t temp;

for (i = 0; i < 40; ++i)
{
rk_perm[i] = i;
}
det = 1.0000000000000000e+00;
for( i=0; i < (39); i++ ) {
	indexMax = i;
	valueMax = fabs(A[i*40+i]);
	for( j=(i+1); j < 40; j++ ) {
		temp = fabs(A[j*40+i]);
		if( temp > valueMax ) {
			indexMax = j;
			valueMax = temp;
		}
	}
	if( indexMax > i ) {
for (k = 0; k < 40; ++k)
{
	acadoWorkspace.rk_dim40_swap = A[i*40+k];
	A[i*40+k] = A[indexMax*40+k];
	A[indexMax*40+k] = acadoWorkspace.rk_dim40_swap;
}
	acadoWorkspace.rk_dim40_swap = b[i];
	b[i] = b[indexMax];
	b[indexMax] = acadoWorkspace.rk_dim40_swap;
	intSwap = rk_perm[i];
	rk_perm[i] = rk_perm[indexMax];
	rk_perm[indexMax] = intSwap;
	}
	det *= A[i*40+i];
	for( j=i+1; j < 40; j++ ) {
		A[j*40+i] = -A[j*40+i]/A[i*40+i];
		for( k=i+1; k < 40; k++ ) {
			A[j*40+k] += A[j*40+i] * A[i*40+k];
		}
		b[j] += A[j*40+i] * b[i];
	}
}
det *= A[1599];
det = fabs(det);
solve_dim40_triangular( A, b );
return det;
}

